VALUES
    (
        'Cheryl',
        'Cheryl came to Tulip experiencing pain, fatigue and headaches. It got so bad she actually had to quit her job. With Tulip, she has regained her energy, decreased her pain, and is now enjoying her part time job!',
        '',
        'https://source.unsplash.com/400x400?man',
        '2022-10-11 13:10:27',
        '2022-10-11 13:10:27',
        102,
        0,
        505
    ),
    (
        'Sam',
        'Sam used to get extremely tired around 3PM and could only finish his workday with the help of coffee. With Tulip, he is now able to maintain consistent energy throughout his day and even has the stamina for a healthy gym session after work!',
        '',
        'https://source.unsplash.com/400x400?woman',
        '2022-10-11 13:10:27',
        '2022-10-11 13:10:27',
        102,
        0,
        505
    ),
    (
        'Jessica',
        'Jessica used to get so tired from any kind of exertion that she would need to stay in bed for an entire day after any significant activity. With Tulip, she is now able to go on hour long jogs and still feel great the next day!',
        '',
        'https://source.unsplash.com/400x400?boy',
        '2022-10-11 13:10:28',
        '2022-10-11 13:10:28',
        102,
        0,
        505
    ),
    (
        'Brian',
        'Brian used to experience extreme anxiety and fatigue any time he had to deal with difficult issues at work. With Tulip, he is now able to cope with work and life challenges in a healthy way while maintaining high energy and a positive mood!',
        '',
        'https://source.unsplash.com/400x400?girl',
        '2022-10-11 13:10:28',
        '2022-10-11 13:10:28',
        102,
        0,
        505
    ),
    (
        'Terri',
        'Terri used to come home exhausted after work, sit on the couch, and not get up for hours. With Tulip, he has the energy to finally enjoy his hobbies again — attending concerts, riding his bike and spending time with friends!',
        '',
        'https://source.unsplash.com/400x400?animation',
        '2022-10-11 13:10:29',
        '2022-10-11 13:10:29',
        102,
        0,
        505
    ),
    (
        'Maya',
        'Maya used to experience so much fatigue that she would need to leave important events very early or not attend them at all. With Tulip, she was finally able to go to her best friend’s birthday party and stay the entire time! ',
        '',
        'https://source.unsplash.com/400x400?man',
        '2022-10-11 13:10:29',
        '2022-10-11 13:10:29',
        102,
        0,
        505
    ),
    (
        'Kristle',
        'Kristle used to be so tired that she was unable to go to the grocery store or cook her own meals. With Tulip, she has been able to get her own groceries, prepare her own meals, and has even hosted a dinner party for her friends!',
        '',
        'https://source.unsplash.com/400x400?woman',
        '2022-10-11 13:10:29',
        '2022-10-11 13:10:29',
        102,
        0,
        505
    ),
    (
        'Cindy',
        'Cindy used to experience extreme dips in energy after lunch and needed to nap in her car just to continue her work day. With Tulip, she feels energized and alert after she eats lunch and no longer takes naps during the day!',
        '',
        'https://source.unsplash.com/400x400?man',
        '2022-10-11 13:10:30',
        '2022-10-11 13:10:30',
        102,
        0,
        505
    ),
    (
        'David',
        'David used to get frequent colds and flus, and he would feel extreme fatigue for weeks following his sicknesses. With Tulip, he has not been sick for months and his overall energy has increased so much that he is now playing tennis again!',
        '',
        'https://source.unsplash.com/400x400?man',
        '2022-10-11 13:10:30',
        '2022-10-11 13:10:30',
        102,
        0,
        505
    ),
    (
        'Barbara',
        'Ever since Barbara reached menopause, she noticed that her energy levels, mood, and sleep quality were distressingly low. With Tulip, she has regained her energy, improved her mood, increased her sleep quality, and feels like a new person!',
        '',
        'https://source.unsplash.com/400x400?man',
        '2022-10-11 13:10:31',
        '2022-10-11 13:10:31',
        102,
        0,
        505
    );

